<script>
    $(document).ready(function () {
        $(".topsearch").on('click', function () {

            if ($(".inputSN").attr('show') == '1') {
                $(".header-search2").hide();
                $(".inputSN").attr('show', '0');
            } else {
                $(".header-search2").show();
                $(".inputSN").focus();
                $(".inputSN").attr('show', '1');
            }
        })

        $(".search_close").on('click', function () {
            $(".inputSN").val('');
            $(".header-search2").hide();
            $(".inputSN").attr('show', '0');
        })
        $(document).click(function (e) {
            var container = $(".topsearch");
            var box = $(".inputSN");
            if (!container.is(e.target) && !box.is(e.target)) {
                $(".inputSN").val('');
                $(".header-search2").hide();
                $(".inputSN").attr('show', '0');
            }


            var target_word = $(".qtiperar");
            var container_box = $(".tooltip_innerbox");
            var others = $(".tooltip_innerbox input,.tooltip_innerbox strong");
            if (!container_box.is(e.target) && !target_word.is(e.target) && !others.is(e.target)) {
                $(".tooltip_main").hide();
                $(".qtiperar").removeClass('active');
            }
        });
    });
</script>

