<script type="application/javascript">
    $("#header_search #inputSN").on("keyup", function () {
        search_bar("#header_search");

    });
    $("#header_search2 #inputSN").on("keyup", function () {
        search_bar("#header_search2");

    });
    $("#searchInput-banner").on("keyup", function () {
        search_bar("#search-banner-sec");

    });
    // Knowledge Search
    $("#know_search_input").on("keyup", function () {
        knowledge_search("#knowledge_search");

    });
    function search_bar(id){
       return;
    }

    function knowledge_search(id) {
        var search = $("" + id + " #know_search_input").val();

        if (search == "") {
            $("" + id + " .search-results").show();
            $("" + id + " .search-results").html("<span class='noresult'>No result found related to your keyword...</span>");
            return false;
        }
        $.ajax({
            url: "/frontend/knowledge_search",
            type: "post",
            data: {search: search},
            dataType: "json",
            success: function (resp) {
                var html = '';
                if (resp.fail) {

                    html = resp.fail;

                    $("" + id + " .search-results").show();
                    $("" + id + " .search-results .withoutlangSearch").html(html);
                    $("" + id + " .search-results .withlangSearch").html(html);

                } else {
                    $("" + id + " .search-results").html('<div class="withlangSearch"></div>');
                    $("" + id + " .search-results").html('<div class="withoutlangSearch"></div>');
                    $("" + id + " .search-results .withoutlangSearch").html("");
                    $("" + id + " .search-results .withlangSearch").html("");
                    $("" + id + " .search-results").hide();

                    if (search.length < 2) {
                        return false;
                    }

                    $("" + id + " .search-results").show();

                    var ToolsArr = resp;


                    var val = clearText($("" + id + " #know_search_input").val());
                    $("" + id + " .search-results .withoutlangSearch").html("");
                    $("" + id + " .search-results .withlangSearch").html("");
                    $("" + id + " .search-results").hide();


                    if (val.length < 2) {
                        return false;
                    }
                    $("" + id + " .search-results").show();
                    var matches = 0;
                    var withoutLang = '';
                    var withLang = '';
                    $.each(ToolsArr, function (index, tool) {

                        var tool_parent = tool[2];
                        var lang_tool = tool[3];
                        var myVal = clearText(tool[0]);

                        if (myVal != "") {
                            matches++;
                            var href = "/" + "knowledge/" + tool[1];
                            var re = new RegExp(val, "gi");
                            var toolName = tool[0].replace(re, "<strong>" + val + "</strong>") + '<span class="resour_parent font-weight-bold pl-2"> <i class="fa fa-long-arrow-right align-middle text-muted"></i> ' + tool_parent + '</span>';
                            if (lang_tool) {
                                withLang += '<span class="match w-100 text-left"><a href="' + href + '">' + toolName + '</a></span>';
                            } else {
                                withoutLang += '<span class="match w-100 text-left"><a href="' + href + '">' + toolName + '</a></span>';
                            }
                        }
                        if (withLang != '') {
                            $("" + id + " .search-results .withoutlangSearch").html('<hr>' + withoutLang);
                        } else {
                            $("" + id + " .search-results .withoutlangSearch").html(withoutLang);
                        }

                        $("" + id + " .search-results .withlangSearch").html(withLang);
                    });
                    if (matches < 1) {
                        $("" + id + " .search-results").html("<span class='noresult'>No result found related to your keyword...</span>");
                    }
                }
            }
        });
    }
</script>

