	}
	if(to_unit == "ft/in"){
		var v 	= $("."+class_name+"0").val();
		return convert_to_FtIn(from_unit , v);
	}

	var x1 	= math.unit($("."+class_name+"0").val() , from_unit);
	x1 		= Number(math.number(x1 , to_unit).toPrecision(2));
	result 	= {"unit" : to_unit , "value" : [[x1]]};
