    Weight Convertion Functions
**********************************/

function gm_to_others(value , unit)
{
    var result = 0;
    if(unit == "kg"){
        result =  value / 1000;
    }else if(unit == "lbs"){
        result = value / 453.592;
    }else if(unit == "oz"){
        result = value / 28.35;
    }else if(unit == "gm"){
        result = value;
    }
    return result;
}

function convert_to_gm (value , unit)
{
    value = Number(value);
    var result = 0;
    if(unit == "kg"){
        result =  value * 1000;
    }else if(unit == "lbs"){
        result = value * 453.592;
    }else if(unit == "oz"){
        result = value * 28.35;
    }else if(unit == "gm"){
        result = value;
    }
    return result;
}

/**********************************
    Currency
**********************************/
$(".currency").keyup(function() {
	var value =	$(this).val();
	var data_country = $(this).attr("data-country");
	var data_cruncy = $(this).attr("data-cruncy");
	value =	value.replace(/[^0-9]+/g,"");
	if(value != ""){
		value =	parseFloat(value);
		value =	value.toLocaleString(data_country, { style: 'currency', currency: data_cruncy , minimumFractionDigits: 0 ,  maximumFractionDigits: 0 });
		$(this).val(value);
	}
})

/**********************************
    Currency
**********************************/
$(".currency2").keyup(function() {
	var value =	$(this).val();
	value =	value.replace(/[^0-9]+/g,"");
	if(value != ""){
		value =	parseFloat(value);
		value =	value.toLocaleString();
		$(this).val(value);
	}
